import * as React from "react";
import * as ReactDOM from "react-dom";
import { Popup } from "@progress/kendo-react-popup";
import "./styles.css";

const AppComponent = () => {
  /* Change left or top value to reposition the popup */
  const offset = {
    left: 150,
    top: 50,
  };
  return (
    <Popup offset={offset} show={true} popupClass={"popup-content"}>
      Popup content.
    </Popup>
  );
};

ReactDOM.render(<AppComponent />, document.querySelector("my-app"));
